import MainContainer from './navigation/MainContainer';
import Landing from './navigation/Screens/Landing';
import { createStackNavigator } from '@react-navigation/stack';
import { StackActions } from '@react-navigation/core';

const Stack=createStackNavigator();
const mainName="Home";
const landName="Land";

const App = () => {
  return (
    <Stack.Navigator initialRouteName={landName}>
      <Stack.Screen name={mainName} component={MainContainer} />
      <Stack.Screen name={landName} component={Landing} />
    </Stack.Navigator>
  );
}

export default App;
